Het lid Cegerek (PvdA) neemt&nbsp;deel aan deze interparlementaire conferentie, uit hoofde van haar rapporteurschap Circulaire Economie.<br />
<br />
&nbsp;

HERZIENE CONVOCATIE<br />
Deze convocatie betreft de inbreng voor feitelijke vragen <strong>over het rapport van de Algemene Rekenkamer enkel voor wat betreft het jaarverslag Ministerie van Infrastructuur en Milieu 2013</strong>. Voor de overige relevante stukken voor de commissie Infrastructuur en Milieu in het rapport van de AR worden afzonderlijke convocaties verstuurd. <strong>NB: het Kamerstuknummer is gewijzigd.</strong><br />
&nbsp;

HERZIENE CONVOCATIE<br />
Deze convocatie betreft de inbreng voor feitelijke vragen <strong>over enkel het rapport van de AR bij het jaarverslag Infrastructuurfonds 2013</strong>. Voor de overige relevante stukken voor de commissie Infrastructuur en Milieu in de bijlage van het rapport van de Algemene Rekenkamer worden afzonderlijke convocaties verstuurd. <strong>NB: het Kamerstuknummer is gewijzigd.</strong><br />
